import { Text, View } from "react-native";
import { TextInput, Button, IconButton } from "react-native-paper";
import {MaterialIcons} from  '@expo/vector-icons'
import AsyncStorage from "@react-native-async-storage/async-storage";
import { useState } from "react";
import { styles } from "../assets/styles/styles";

let cars = [{ plateNumber: "1010", brand: "SUPRA", state: "Disponible" }];

export default function CarScreen({ navigation }) {
  const [plateNumber, setPlateNumber] = useState("");
  const [brand, setBrand] = useState("");
  const [state, setState] = useState("");
  const [errorMess, setErrorMess] = useState("");

  const getValuesRent = async () => {
    let values = await AsyncStorage.getItem("keyRent");
    return new Promise((resolve, reject) => {
      if (values.length === 0) {
        reject(new Error("No existen datos"));
      } else {
        setTimeout(() => {
          resolve(JSON.parse(values));
        }, 1500);
      }
    });
  };

  let saveCar = () => {
    const saveArrayCar = getValuesRent();
    saveArrayCar
      .then((values) => {
        if (plateNumber === "" || brand === "") {
          setErrorMess("Ingrese todos los valores");
        } else {
          let findCar = values.find(
            (value) => value.plateNumber == plateNumber);
          if (!findCar) {
            values.push({plateNumber: plateNumber,brand: brand,state: true});
            AsyncStorage.setItem("keyCar", JSON.stringify(values));
            setErrorMess("Placa Ingresado");
          }
        }
      })
      .catch((Error) => {
        console.log(Error.message);
        if (plateNumber === "" || brand === "") {
          setErrorMess("Ingrese todos los valores");
        } else {
          let obj = [{ plateNumber: plateNumber, brand: brand, state: true}];
          AsyncStorage.setItem("keyCar", JSON.stringify(obj));
          setErrorMess("Placa Ingresada");
        }
      });
  };

  let searchCar = () => {
    const searchValueCar = getValuesRent();
    searchValueCar
      .then((values) => {
        let loadCar = values.find((value) => value.plateNumber === plateNumber);
        if (plateNumber === "") {
          setErrorMess("Ingrese todos los valores");
        } else if(loadCar != undefined){
            setBrand(loadCar.brand);
            setState(loadCar.state ? 'Disponible':'NO Disponible');
            setErrorMess("Placa encontrada");
         } else {
            setErrorMess("Placa no existe");
          }
        })
      .catch((Error) => {
        console.log(Error.message);
        if (plateNumber === "") {
          setErrorMess("Ingrese una placa");
        } else {
          setErrorMess("Placa no existe");
        }
      });
  };

  let Limpiar = () => {
    setPlateNumber("");
    setBrand("");
    setState("");
    setErrorMess("");
  };

  return (
    <View style={[styles.container, { backgroundColor: "#D2EDFF" }]}>
      <Text style={{ fontWeight: "bold" }}>Ingresar Carro</Text>
      <TextInput
        style={styles.texinput}
        activeOutlineColor="#000000"
        outlineColor="#000000"
        label="Nro Placa"
        mode="outlined"
        onChangeText={(plateNumber) => setPlateNumber(plateNumber)}
        value={plateNumber}
      />
      <TextInput
        style={styles.texinput}
        activeOutlineColor="#000000"
        outlineColor="#000000"
        label="Marca"
        mode="outlined"
        onChangeText={(brand) => setBrand(brand)}
        value={brand}
      />
      <TextInput
        style={styles.texinput}
        activeOutlineColor="#000000"
        outlineColor="#000000"
        label="Estado"
        mode="outlined"
        editable={false}
        value={state =='' ? 'Disponible': state}
      />
      <View style={[{ backgroundColor: "#D2EDFF", flexDirection: "row" }]}>
        <Button
          style={{ marginTop: 10, marginEnd: 10 }}
          icon='share'
          mode="contained"
          buttonColor="#0076C2"
          onPress={saveCar}
        >Guardar</Button>
        <Button
          style={{ marginTop: 10 }}
          icon='repeat'
          mode="contained"
          buttonColor="#0076C2"
          onPress={searchCar}
        >Listar</Button>
      </View>
      <Button textColor="#0076C2" onPress={Limpiar}>Limpiar</Button>
      <Text style={{ fontWeight: "bold", marginTop: 10, color: "red" }}>{errorMess}</Text>
    </View>
  );
}
